DROP TABLE IF EXISTS master;
CREATE TABLE master(
   bioID         VARCHAR(9) NOT NULL PRIMARY KEY
  ,useFirst      VARCHAR(11)
  ,firstName     VARCHAR(11)
  ,middleName    VARCHAR(20)
  ,lastName      VARCHAR(18) NOT NULL
  ,nameGiven     VARCHAR(6)
  ,fullGivenName VARCHAR(30)
  ,nameSuffix    VARCHAR(3)
  ,nameNick      VARCHAR(50)
  ,pos           VARCHAR(5)
  ,firstseason   INTEGER 
  ,lastseason    INTEGER 
  ,height        NUMERIC(5,2)
  ,weight        INTEGER 
  ,college       VARCHAR(36)
  ,collegeOther  VARCHAR(55)
  ,birthDate     VARCHAR(10)
  ,birthCity     VARCHAR(25)
  ,birthState    VARCHAR(11)
  ,birthCountry  VARCHAR(3)
  ,highSchool    VARCHAR(63)
  ,hsCity        VARCHAR(49)
  ,hsState       VARCHAR(17)
  ,hsCountry     VARCHAR(9)
  ,deathDate     VARCHAR(10) NOT NULL
  ,race          VARCHAR(1)
);
